create table images
(
    id         serial
        primary key,
    title      varchar(255) not null,
    path       varchar(255) not null,
    profil_id  integer      not null
        constraint images_users_id_fk
            references users,
    date_added date default CURRENT_TIMESTAMP
);

alter table images
    owner to sammy;

grant delete, insert, references, select, trigger, truncate, update on images to sammy;

